import NavBar from '../features/navbar/Navbar';
import Contact from '../features/contact/Contact';
function ContactPage() {
    return (
        <div>
          <NavBar>
            <h1 className='mx-auto text-2xl'>Contact Us</h1>
            <Contact></Contact>
          </NavBar>
        </div>
      );
}

export default ContactPage;
